let SidenavPositionInstance = null;
module.exports = class sidenavPosition {

    constructor() {
        if (!SidenavPositionInstance) {
            SidenavPositionInstance = this;
            //set all other default values

            this.displayAs = 'Sidenav Position';
            this.value = '[sidenavPosition]'
            this.type = 'DROPDOWN';
            this.values = [
                { display: "Start", value: "'start'"},                
                { display: "End", value: "'end'"},

            ];
        }

        return SidenavPositionInstance;
    }
}